// labelVideoMapping.js
const labelVideoMapping = [
  { name: "Sit", video: "/videos/sit.mp4" },
  { name: "Forward Bend", video: "/videos/forward_bend.mp4" },
  { name: "Warrior Pose", video: "/videos/warrior_pose.mp4" },
  { name: "Triangle Pose", video: "/videos/triangle_pose.mp4" },
  { name: "Vajrasan", video: "/videos/vajrasan.mp4" },
  { name: "Backward Bend Pose", video: "/videos/backward_bend_pose.mp4" }
];

export default labelVideoMapping;
